        self.books.append(book_id)

    def remove_book(self, book_id):
        self.books.remove(book_id)

    def pop_left(self):
        return self.books.pop(0)

    def pop_right(self):
        return self.books.pop()

    def get_leftmost_id(self, book_id):
        return min(self.books[:self.books.index(book_id)])

    def get_rightmost_id(self, book_id):
        return min(self.books[self.books.index(book_id) + 1:])

